//     <div className="App">
//       <Auth/>      
//       <AuthFree/> 
//     </div>
//   );
// }

const App = () => {
  const [showModal, hideModal] = useModal(() => (
    <ReactModal isOpen>
      <p>{<Auth/>}</p>
      <button onClick={hideModal}>Hide modal</button>
    </ReactModal>
  ));

  const [showModal2, hideModal2] = useModal(() => (
    <ReactModal isOpen>
      <p>{<Auth/>}</p>
      <button onClick={hideModal2}>Hide modal</button>
    </ReactModal>
  ));

  return (
    <>
      <button onClick={showModal}>Show modal</button>
      <button onClick={showModal2}>Show modal2</button>
    </>
  );
};

export default App;
